class Espera {
  constructor() {
    this.div = document.createElement("div");
    this.div.style.display = "none";
    document.body.appendChild(this.div);
    this.div.style.position = "fixed";
    this.div.style.top = "25%";
    this.div.style.left = "40%";
    this.div.style.width = "170px";
    this.div.style.height = "150px";
    this.div.style.background = "url(data:image/gif;base64,) center no-repeat";
    this.div.style.backgroundSize = "100px 100px";
  }
  mostrarEspera() {
    this.div.style.display = "block";
  }

  ocultarEspera() {
    this.div.style.display = "none";
  }
}

